INSERT INTO `aos_goods` VALUES ('1', '1', 'AOS000001', '【越南进口】精品越南百香果鸡蛋果5斤装（单果70g-90g）精挑中大果实惠装[演示网站不发货]', '562', '0', '', '72', '2.450', '36.00', '358', '1.00', '1', '【坏果包赔】 百香果含有17种氨基酸，丰富的蛋白质、脂肪、糖、维生素、钙、磷、铁、钾、SOD酶和超纤维等165种对人体有益物质，更被称为水果中的VC之王，口感独特（种子香脆可口，营养丰富）。 食方网百科上说百香果有消炎止痛、活血强身、降脂降压、滋阴补肾、提神醒酒、消除疲劳、护肤养颜等神奇功效，制作成饮料，冷热饮皆宜，口味极佳，常饮还有消除青春痘、消除痔疮、消除肠胃炎。', '<img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150234_61199.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150234_80425.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150234_32150.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150234_86316.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150235_97659.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150235_55617.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150236_61994.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150236_79723.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150236_54896.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150237_61429.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150237_90648.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150237_47451.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150237_41662.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150237_26996.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150238_84643.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150238_36808.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150238_40353.jpg\" alt=\"\" />', 'uploads/goods_img/1_1494297876063.jpg', 'uploads/tuan_img/1_1494297876994.jpg', '', '1', '0',