INSERT INTO `aos_goods` VALUES ('4', '1', 'AOS000004', '【品质水果】四川蒲江果园现摘现发青见柑橘5斤（果重150g-300g）【带叶发货】 口感鲜嫩[演示网站不发货]', '617', '0', '', '83', '0.000', '48.00', '158', '0.01', '1', '【品质优选 24H发货 坏果包赔】四川蒲江丑橘的母本—青见，果皮薄，包着较紧，但仍易剥离，肉色橙红，肉质细嫩。汁多化渣，果汁糖度11°~12°左右，含酸量为1%左右，酸甜爽口，香气宜人，品质优。', '<img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150535_36620.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150535_57152.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150536_24658.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150536_58151.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150536_39528.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150536_19838.jpg\" alt=\"\" />', 'uploads/goods_img/4_1494239871755.jpg', 'uploads/tuan_img/4_1494239871790.jpg', '', '1', '0', '1494239871', '998', '0', '0', '0', '0', '20', '1513909278', '', '-1', null, '1,2,3,4', '0.00', '', '2', '0', '0.00', '0.00', '');
INSERT INTO `aos_goods` VALUES ('5', '1', 'AOS000005', '山西丑苹果红富士苹果80#中大果10斤 果径80-95mm 水裂纹苹果长得丑口感好PK洛川阿克苏孕妇苹果面苹果粉苹果[演示网站不发货]', '200', '0', '', '95', '0.000', '48.90', '58', '35.90', '1', '【坏果包赔】丑苹果就像沉默的大多数一样，长得不漂亮，而且因为浇黄河水长大，生长太快会有水裂纹产生，卖相不好，但是口感好，量大，价格低，所以特别受国内市场欢迎。', '<img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150620_33579.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150621_35236.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150621_35253.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150622_61962.jpg\" alt=\"\" />', 'uploads/goods_img/5_1494240764997.jpg', 'uploads/tuan_img/5_1494240764205.jpg', '', '1', '0', '1494240764', '995', '0', '0', '0', '0', '0', '1494313586', '', '-1', null, '1,2,3,4', '0.00', null, '0', '0', '0.00', '0.00', '');
INSERT INTO `aos_goods` VALUES ('6', '1', 'AOS000006', '越南红心火龙果 4个 单果350-450g 鲜嫩多汁 新鲜直达[演示网站不发货]', '72', '0', '', '99', '0.000', '89.00', '85', '55.00', '1', '火龙果是仙人掌科三角柱属多年生蔓性植物，是一种新兴的有良好保健功效的水果，原产于西半球赤道附近，中美洲热带雨林地区。火龙果是长寿植物，成活几十年乃至上百年。因其含有的独特成份，对人体有绝佳的保健功效。', '<img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150645_72764.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150645_99689.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150645_58653.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150645_73577.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150645_45151.jpg\" alt=\"\" />', 'uploads/goods_img/6_1494241039565.jpg', 'uploads/tuan_img/6_1494241039126.jpg', '', '1', '0', '1494241039', '994', '0', '0', '0', '0', '0', '1494313609', '', '-1', null, '1,2,3,4', '0.00', null, '0', '0', '0.00', '0.00', '');
INSERT INTO `aos_goods` VALUES ('7', '1', 'AOS000007', '海南三亚菠萝蜜一整个现摘现发 香甜甜[演示网站不发货]', '61', '0', '', '99', '0.000', '98.00', '16', '85.00', '1', '【坏果包赔】温馨提醒：菠萝蜜收到硬的不能切开哦！判断生熟：摁着各个部位都软了，类似于皮球，闻着有浓郁的香气！这时可以用小刀切个小口尝尝，切记不要一刀两半！到货没熟切开不包赔。水果发货标准17-22斤，菠萝蜜路上会蒸发1.5-2斤水分，到货低于16斤连词客服补差价（补差价需要提供电子称称重图和快递单照片）生鲜水果在快递过程中受天气和快递装卸的影响，可能会有部分坏果出现，当您收到宝贝后，及时打开检查发现有坏果的情况，请及时拍照（需要及时提供坏果的部分放在快单上的照片）并在签收24小时内将图片发给客服。我们会及', '<img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150704_59301.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150704_80654.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150705_33283.jpg\" alt=\"\" />', 'uploads/goods_img/7_1494241305196.jpg', 'uploads/tuan_img/7_1494241305181.jpg', '', '1', '0', '1494241305', '993', '0', '0', '0', '0', '0', '1494313629', '', '-1', null, '1,2,3,4', '0.00', null, '0', '0', '0.00', '0.00', '');
INSERT INTO `aos_goods` VALUES ('8', '1', 'AOS000008', '【越南进口】青芒果8斤（单果200-400g）个大核薄 甜蜜多汁[演示网站不发货]', '59', '0', '', '10', '0.000', '79.00', '35', '65.00', '1', '【坏果包赔】 芒果为著名热带水果之一，又名檬果、漭果、闷果、蜜望、望果、庵波罗果等，深受人们喜爱，素有“热带果王”之誉称。越南青芒果，果实肾形厚度扁平，果腹面有一条明显的沟槽，比一般的青芒果更要硕大饱满。成熟果皮为青黄色或暗绿色，果实后熟后，果皮黄绿色，果肉淡黄至奶油黄色，核较大而薄，多胚，品质极优，是较理想的鲜食品种。', '<img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150730_10205.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150730_28042.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150730_96853.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150731_79328.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150731_62553.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150731_25348.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150732_43394.jpg\" alt=\"\" />', 'uploads/goods_img/8_1494292454458.jpg', 'uploads/tuan_img/8_1494292454921.jpg', '', '1', '0', '1494292454', '992', '0', '0', '0', '0', '0', '1521885290', '', '-1', null, '2,3,4', '0.00', '', '0', '0', '0.00', '0.00', '');
INSERT INTO `aos_goods` VALUES ('9', '1', 'AOS000009', '【品质水果】山东寿光羊角蜜甜瓜5斤(单果400-1000g)丨香脆多汁 果味香浓[演示网站不发货]', '112', '0', '', '100', '0.000', '128.00', '4677', '35.80', '1', '【品质优选 24H发货 坏果包赔】山东即墨仓发货，，下单现采，经过人工层层筛选，自然成熟，不做催熟处理，源自大自然的新鲜口感，脆甜多汁，颜色喜人心情好，生食榨汁停不住。任何售后问题联系在线客服，我们第一时间帮亲处理，满意给予好评哦。', '<img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150758_75374.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150758_57665.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150758_32593.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150759_17920.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150759_13844.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150759_13393.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509150759_42060.jpg\" alt=\"\" />', 'uploads/goods_img/9_1494292933338.jpg', 'uploads/tuan_img/9_1494292933867.jpg', '', '1', '0', '1578302070', '991', '0', '0', '0', '0', '0', '1578302055', '', '-1', null, '1,2,3,4', '0.00', '', '2', '0', '0.00', '0.00', '');
