INSERT INTO `aos_goods` VALUES ('14', '1', 'AOS000014', '【泰国进口】泰国榴莲 1个 4-5斤到货即可食用营养丰富奶香四溢入口融化口感独特 果肉厚实饱满酥软味甜 香甜浓郁 水果皇后[演示网站不发货]', '59', '0', '', '96', '0.000', '288.00', '93', '118.00', '1', '【坏果包赔】我们选择8成熟的果子发出，到货即可食用。泰国榴莲， 口感独特，榴莲香气浓郁，果肉厚实饱满，酥软味甜，如果收到外表青的建议放两天再吃哦，另外榴莲是大果，从产地装车后，随着成熟度不断偏高，榴莲本身的重量也会越变越轻，这叫干耗，但是对果肉的重量都是没有影响的哦。无忧售后，收到如果有坏果，请在24小时连同快递单拍照，交给我们客服办理理赔。由于水果会自然坏掉，超过24小时将不能办理理赔。', '<img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509151014_76967.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509151015_49062.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509151015_69346.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509151015_39916.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509151015_18749.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509151015_33030.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509151016_36077.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509151016_51177.jpg\" alt=\"\" /><img src=\"http://demo.ptuan.com.cn/pt/uploads/image/20170509151016_61557.jpg\" alt=\"\" />', 'uploads/goods_img/14_1494295534566.jpg', 'uploads/tuan_img/14_1494295534018.jpg', '', '1', '0', '1494295534', '986', '0', '0', '0', '0', '0', '1500875350', '', '-1', null, '1,2,3,4', '0.00', null, '0', '0', '0.00', '0.00', '');
