INSERT INTO `sxtm_ysqgk` VALUES ('2', '1', '1', '2009430001', '个体', null, '612425198308020595', '杨典成', '电子邮件', 'yangdiancheng@126.com', '西安市军警路东三爻村150号', '--', ' 我想办理西安到安康高速路的线路经营权请问如何办理需要什么手续', '  准备办理一趟车次的经营权', '13992861942', '2009-04-30 00:37:59', '1', null, null, '0', '0', null, '0', null, '1', '2009-05-07 00:00:00', '0', null, '杨先生你好，你的信息我局已受理，现答复如下： \r\n    根据国家《道路运输条例》和交通运输部《道路旅客运输及客运站管理规定》，西安至西康高速客运班线属于一类班线，个人无资格从事该班线运营。\r\n', null, null, '0', null, '', '0');
