INSERT INTO `sxtm_ysqgk` VALUES ('5', '1', '2', '2009623001', '陕西中天旅行社有限公司', null, '5', null, '电话告知', '85404016@qq.com', '西安市文艺路和平花园C802', '029-87882923-', '我公司目前准备投资2000万购置旅游汽车40辆，3-5年目标是200辆。进行旅游客运。但是在办理过程中遇到了一些困难。我们要做的是统一管理的正规车队，为什么不能申请？而且有外地上市公司做支持。望能早回复！', '成立西安第一家统一管理的正规车队，规模至少200辆，资产1个亿。', '13519194866', '2009-06-23 18:41:26', '1', null, null, '0', '0', null, '0', null, '1', '2009-06-27 00:00:00', '0', null, '已经电话告知。告知内容：请申请人先前往经营组织所在地的道路运输管理机构进行省际（省内）旅游车辆行政许可申请。', null, null, '0', null, '79793837-X', '0');
