INSERT INTO `sxtm_ysqgk` VALUES ('9', '1', '1', '20091124001', '个体营运货车', null, '610122198501035214', '穆争辉', '电话告知', 'www@376741085', '蓝田县，九间房乡穆家堰村六组', '--', '我是03年5月考到的驾驶证。同月我在我们当地县城运证部门办理了货运资格证。\r\n直到今年的5月份我换取新的资格证时却发现资格证比驾驶证还早了几天，于是工作人员给我不换证说我的资格证作废了。我现在真的很郁闷不知该怎么办。', '换证', '13892874573', '2009-11-24 14:20:15', '1', null, null, '0', '0', null, '0', null, '1', '1900-01-01 00:00:00', '0', null, '已经转交驾培管理处予以答复，并确认已经答复。', null, null, '0', null, '', '0');
