INSERT INTO `sxtm_ysqgk` VALUES ('22', '1', '1', '2012317001', '现无工作单位', null, '612324198409120032', '陈天柱', '电话告知', 'chen_tian_zhu@163.com', '', '--', ' 你们好，我是汉中市西乡县人，我于2011年5月份在西乡县金龙驾校报名，录取后我们被安排于5月8日去西安参加机动车教练员培训。5月17日培训结束，我们全科通过后回西乡。可是驾校到现在依然没有安排上班。我们曾多次联系驾校，他们给的理由是教练员证没回来。请帮忙查一下是不是真的没发我们的教练员证？谢谢！！！', '烦请电话通知我一下，谢谢', '', '2012-03-17 22:16:17', '1', null, null, '0', '0', null, '1', null, '1', '2012-03-26 10:43:00', '0', null, '已于3月17日予以电话答复。', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('23', '1', '1', '2012424001', '蓝田县蓝通运输公司', null, '610122197209060012', '郑卫国', '电子邮件', '13891850099@139.com', '蓝田县蓝关镇', '--', '1、现在更新的同村客运车辆，还能享受政府各项补贴吗？\r\n2、我省具体客车等级划分标准。\r\n3、客车等级对应的营运期限。\r\n4、在回复中明确文件编号。', '学习政策，为同村客运车辆更新寻求参考。麻烦您们了请答复。', '13891850099', '2012-04-24 18:52:00', '1', null, null, '0', '0', null, '0', null, '1', '2012-04-26 13:58:46', '0', null, '你好，你申请公开的信息已经以电子邮件的形式反馈给你！请查收。', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('24', '1', '1', '201252001', '复原军人', null, '610121197509047438', '李波利', '电子邮件', '457299380@qq.com', '长安区北长安街茗景城2B20403', '--', '本人合伙计划投资5到6辆客车在本市范围内用于单位包车经营，现不知如何办理相关手续，才能合法经营望贵局给予解答。在此甚为感谢！', '自主合伙创业', '15339277649', '2012-05-02 18:46:41', '1', null, null, '0', '0', null, '0', null, '1', '2012-05-07 16:16:25', '0', null, '你好，你申请公开的信息已经以电子邮件的形式反馈给你！请查收。', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('25', '1', '1', '201257001', '陕西正好钢结构有限公司', null, '612525198703125755', '闵加涛', '电话告知', 'minjiatao@163.com', ' 陕西省莲湖区大兴西路邓家村', '--', '您好：我有一辆昌河福瑞达面包车现想自用有时拉些配件等货，续办营运证，请问我在那找谁办理,需要些什么材料  什么证件，', '续办营运证，自用拉点货', '13109504595', '2012-05-07 23:41:03', '1', null, null, '0', '0', null, '0', null, '1', '2012-05-09 15:54:51', '0', null, '已经于5月9日电话告知,并通过电子邮件回复。  \r\n', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('26', '1', '1', '2012621001', '无', null, '610111197010231516', '张继东', '电话告知', '', '', '--', '油罐车无押运员咋处罚', '车被扣', '18991128153', '2012-06-21 16:15:13', '1', null, null, '0', '0', null, '0', null, '1', '2012-06-25 14:02:06', '0', null, '张先生：\r\n你好！\r\n按照交通运输部《道路危险货物运输管理规定》第三十六条“在道路危险货物运输过程中，除驾驶人员外，专用车辆上应当另外配备押运人员。押运人员应当对运输全过程进行监管。”和第五十三条第三项规定“运输、装卸危险化学品不符合国家有关法律、法规、规章的规定和国家标准，并未按照危险化学品的特性采取必要安全防护措施的”，处以２万元以上１０万元以下的罚款。\r\n', null, null, '0', null, '', '0');
