INSERT INTO `sxtm_ysqgk` VALUES ('33', '1', '1', '2013514001', '上海凯颂贸易发展公司', null, '452128198902021032', '廖立坚', '电子邮件', 'ssddddd@qq.com', '上海普陀区靖边路199弄17号803室', '021-66321397-', '我前段日子在你们商洛市办了张道路货运从业人员资格证，我想验证一下是不是真的。', '因为我现在的单位要求我出示证明是真的', '15221902400', '2013-05-14 18:20:23', '1', null, null, '0', '0', null, '0', null, '1', '2013-05-16 09:59:11', '0', null, '您好，你咨询的问题已通过电子邮件回复，请查收。', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('34', '1', '1', '2013524001', '汉中', null, '610124198211180053', '周利', '电子邮件', '2533519577@qq.com', '', '--', '跨市线路的申报程序。如果和老线路有冲突怎么解决老线路更车需什么材料', '老线路更车。', '13572566501', '2013-05-24 19:37:14', '1', null, null, '0', '0', null, '0', null, '1', '2013-05-29 10:57:44', '0', null, '一、跨市线路的申报必须由具有相应资质的道路客运企业提出，先上报市级道路运输管理机构初审，通过后报省级道路运输管理机构审核。目前我省已暂停受理市际新增班线申请。\r\n二、根据有关规定，拟新增线路与老线路里程重合70%以上的，将严格控制。\r\n三、老线路更车，应由经营客运企业依照相关规定向道路运输管理机构申报。\r\n', null, null, '0', null, '', '0');
