INSERT INTO `sxtm_ysqgk` VALUES ('36', '1', '1', '201372001', '西安周至县', null, '610124198211180053', '周利', '电话告知', '893057919@QQ,COM', '西安市周至县二曲镇八一村', '--', '你 好 ，我 是经营汉中-周至班车的经营户现在老车下线，我 想了解我省跨市高速新增班线现在审批办理这没有 急急急；', '了解情况', '13572566501', '2013-07-02 11:06:14', '1', null, null, '0', '0', null, '0', null, '1', '2013-07-08 09:55:59', '0', null, '已于7 月8日电话回复当事人。', null, null, '0', null, '', '0');
