INSERT INTO `sxtm_ysqgk` VALUES ('38', '1', '1', '201431001', '陕西宝鸡', null, '610303810326201', '张文博', '邮寄', 'jafter@163.com', '陕西宝鸡联盟花园2号楼', '--', '特种车辆汽车起重机（吊车）是否属于道理运输管理，道路运营证是否需要办理，驾驶汽车起重机是否需要道路运输从业资格证，汽车起重机在道路行驶是否需要接受运管部门的检查', '一些地方检查部门根本说不清汽车起重机是否需要相关证件和相关管理规定！', '13571720016', '2014-03-01 19:04:46', '1', null, null, '0', '0', null, '0', null, '1', '2014-03-04 09:07:43', '0', null, '已通过电子邮件回复当事人', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('39', '1', '1', '2014427001', '徐工集团建设机械分公司', null, '320321199007244838', '刘中奎', '电话告知', 'zhongkui1990@163.com', '陕西榆林市高速路口附近', '--', '我把榆林恒泰驾校迟迟不考科目三的情况反应给了榆林晚报，人家给的回复“你好，是这样的。我们记者已经对您反映的情况进行了采访。问题出在科目二考试的考场上，因为那个考场当时还不是省交警总队安装监控的考场，所以导致当时你们考试的成绩没法录入，也就考不成科目三。你们这个情况交警支队已经上报总队及部里，目前也在等消息。”  我想问一下，2014年1月份科目二就考完了，现在还不考科目三，我都快崩溃了，我是2013年9月底报的名', '2013年9月份报名，到现在还没拿到驾照，实在等不起，想尽快考取科目三，争取早些拿驾照', '18652225576', '2014-04-27 15:14:27', '1', null, null, '0', '0', null, '0', null, '1', '2014-04-30 08:26:43', '0', null, '已电话答复咨询人。', null, null, '0', null, '', '0');
