INSERT INTO `sxtm_ysqgk` VALUES ('43', '1', '1', '2014716001', '西安宏安驾驶员培训有限公司', null, '610103198212110434', '刘锋', '电话告知', '29720798@QQ.com', '西安市未央区东风路家润碧泽园', '--', '我的教练证丢失了，需要补办一个，', '补办教练证', '13659297368', '2014-07-16 22:07:14', '1', null, null, '0', '0', null, '0', null, '1', '2014-07-17 10:09:42', '0', null, '已于7月17日电话答复当事人。', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('44', '1', '1', '201484001', '西安思源学院', null, '341204198805252216', '吴宇', '电话告知', '653431395@qq.com', '西安市灞桥区东郊水安路28号西安思源学院', '--', '各位领导您好！我是一名十月份离校的大四学生，户籍安徽阜阳，于今年三月七号报考西安庆华驾校纺织城工人文化宫分校，由于十月离校实习，报驾校时再三询问考虑，驾校都答应七月之前保证拿到证，可他们再三糊弄我，迟迟让我从三月等到八月，浪费了我六个月不说，他们现在分校与总校相互推脱责任，也没人管我的事儿，多次求助无果，只能求助贵局，眼看十月来临，要离开西安去上班，可科一还不让我考，这样下去估计到明年都拿不到证，望您们帮我主持公道，让我尽快考试，谢谢', '庆华驾校故意拖延我三月到现在还不让考科一，望通过此途径解决驾校对我考试继续拖延', '18710925217', '2014-08-04 20:28:48', '1', null, null, '0', '0', null, '0', null, '1', '2014-08-20 08:10:18', '0', null, '已通过电话回复当时人。', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('45', '1', '1', '2014117001', '陕西省咸阳市杨凌区', null, '610403197102272012', '巨红军', '电话告知', '', '', '--', '我是陕西省平安运输公司杨凌分公司杨凌到汉中车次的参营者，车号为陕v61877，对于新增眉县到汉中车次公示提出意见，杨凌到汉中平时上客率只有20%左右，主要靠杨凌和眉县的上客，在客运车上都有视频记录，可以随时查看相关情况。若增加眉县到汉中的客运车次，路上的客人分散，对两辆车都会有影响，两者都无法正常运行，希望运输局的领导可以慎重考虑，可以对这件事认真视察。', '希望不要眉县到汉中新增车次，不要对其他其他车次造成影响', '13891914831', '2014-11-07 23:15:02', '1', null, null, '0', '0', null, '0', null, '1', '2014-11-27 08:24:25', '0', null, '已通过信访渠道由许可处进行解决答复。', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('46', '1', '2', '20141127001', '西安绿天商贸有限公司', null, '', null, '电子邮件', '85150430@qq.com', '西安市未央区明光路', '--', '我们单位新买了一台微型货运车，是为了配送我们的货物给经销商，载货质量为0.4T。', '请问需要办理营运证吗？', '18509238854', '2014-11-27 18:41:26', '1', null, null, '0', '0', null, '0', null, '1', '2014-12-11 16:05:20', '0', null, '根据《道路货物运输及站场管理规定》（交通运输部2012年1号令）第一章第二条，道路货物运输经营是指为社会提供公共服务、具有商业性质的道路货物运输活动。若你公司不经营为社会提供公共服务、具有商业性质的道路货物运输业务，则不需要办理道路运输经营许可证，该车辆也不需办理营运证。但需要提醒你公司：\r\n1、此车在货物运输过程中应确保仅为你公司自用，不得转借其他单位或非你公司员工的个人进行货物运输。\r\n2、配送范围应为你公司的产品配送给经销商且不收取费用，不得运输非你公司产品或出现含运价结算的运输行为。\r\n如一旦发现你公司货运车辆违反以上两条，从事营业性运输，相关部门则会按照《中华人民共和国道路运输条例》和《道路货物运输及站场管理规定》相关条款予以处罚。\r\n', null, null, '0', null, '31103416-0', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('47', '1', '1', '201537001', '江苏', null, '610328197809100611', '赵', '电话告知', '2500459593@qq.com', '', '--', '陕D90131站外乱下 乘客   \r\n陕A70334票价乱涨\r\n欺客拒载\r\n          ', '严整客运市场', '18291041179', '2015-03-07 15:49:37', '1', null, null, '0', '0', null, '0', null, '1', '2015-03-13 08:08:00', '0', null, '已通过电话与当事人联系，并答复。', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('48', '1', '1', '2015316001', '个体户经商', null, '61042719850529747', '董小艳', '电话告知', '335122595', '西安市丰庆路安康办', '029-8865-7044', '本人现居西安，老家咸阳彬县龙高镇人士，近几年陕西的建筑突飞猛进的再改建，是人们的生活越来越舒心，方便，快捷，自由。在我第一次坐私家车从西安到龙高镇时，走的是西安到旬邑路线，这条路据说是刚健好的，路面平稳，笔直，宽敞。没有波澜起伏，更没有S路线，但是我发现路上车辆很少，也没长途汽车的痕迹，我想这条路这么好怎么没人走哪？而且也省时间。我想国家给我们修了这条路，我们怎么能不运用它为人民服务哪？人们也是更需求的。\r\n\r\n     望各位领导批准，给我开通龙高镇到西安的长途客车，从龙高镇—土桥—咸阳—西安站路线。特此申请，望领导海涵。', '为了人们的需求，为了人们的方便我董小艳申请龙高镇—西安长途客运路线，路线途径从龙高镇—土桥—咸阳—西安站路线', '13289821368', '2015-03-16 18:17:23', '1', null, null, '0', '0', null, '0', null, '1', '2015-03-23 10:04:45', '0', null, '已于3月19日上午电话答复当事人。', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('49', '1', '1', '2015813001', '下岗工人现经营客运班车', null, '610202196302163214', '杨先生', '电话告知', '', '陕西省旬邑县', '--', ' 我是陕D23456车主，旬邑—铜川正常经营当中已缴纳线路使用费3万元，本应在2015年7月更换新的线路使用牌却迟迟得不到更换致使车辆无法正常经营被迫停运！本人经营期间按规定缴纳所有费用，经营时间长达15年，至此对贵公司不发放新的线路使用牌提出质疑！要求给予合理的说法和处理结果，并要求得到正常营运损失赔偿！\r\n       本人依法按照陕西省交通厅规定向咸运集团讨回应有的权利和说法！\r\n             ', '本人自下岗以来一直靠经营客运班车为生！一家老小全靠我一个人经营车来养活，经营期间按公司规定所缴纳的费用从未少交！也请领导给我一个合理的结果，我本人经营期间完全按照公司规定制度合法经营！', '1629007257', '2015-08-13 00:15:34', '1', null, null, '0', '0', null, '0', null, '1', '2015-10-16 15:17:41', '0', null, '已于8月19日电话回复', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('50', '1', '1', '20151014001', '麟游县麒麟出租车公司出租车司机', null, '610427198206020018', '杨小鹏', '电话告知', '1015287128@qq.com', '陕西省咸阳市彬县', '--', '我是麟游县麒麟出租车公司的一名司机，我和公司的关系是合作关系，我是出租车的实际出资人，公司实际就是皮包公司，2012年4月分公司第一次给我们上车时候省交通厅给的指表是麒麟出租车公司是20辆车，现在已经上了30辆车了，导致市场生意都不景气，现在在没有开听证会情况下，又要在曾加5辆出租车，我们没办法经营下去了。', '希望省交通厅出面给我们解决这个难题，没有省交通厅的指标它们有什么权利上车。', '18220616041', '2015-10-14 21:59:56', '1', null, null, '0', '0', null, '0', null, '1', '2015-10-16 15:14:26', '0', null, '已回复', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('51', '1', '1', '20151119001', '安徽', null, '610428199107021315', '杨涛涛', '电子邮件', '1179016320@qq.com', '安徽芜湖', '--', '陕西跑长线的黑车群举报。\r\n386446744QQ群里面10多个黑车司机整天招揽人员，主要方向是往长武甘肃一带拉人和旅游景点拉人。', '打击犯罪，作为陕西省的公民我有这个责任。', '18329797311', '2015-11-19 09:40:04', '1', null, null, '0', '0', null, '0', null, '1', '2015-11-24 09:49:37', '0', null, '已于11月23日通过电子邮件回复给咨询者', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('52', '1', '1', '2016111001', '西安慧源能源技术服务有限公司', null, '610424198211152374', '白钊', '电子邮件', '13991945457@126.com', '西安市长安中路89号阳明国际大厦', '--', '1.陕西省登记在册的四轴以上重型货车总数量\r\n2.1其中注册在公司（非个人）的车辆数量\r\n3.2其中拥有20辆四轴以上重型货车以上的公司数量，拥有50辆以上的公司数量\r\n4.数量最多的前十名企业名称', '领导您好，我是西安慧源能源技术服务有限公司的项目总监，同时也是西安欧亚学院和西安财经学院的统计学兼职课外辅导老师。\r\n考虑到目前全国运输企业的困境，我计划和学校学生开展为运输企业降低运营成本的课题研究，主要针对目前的大货运运输企业的燃料使用状况、关注因素等多方面考虑。但目前市场的个人车辆太多，头绪太乱，所以想从公司化运营的运输企业着手，希望领导能提供部分数据支持，谢谢。由于目前课题还处于前期阶段，无法提供学校的相关证明，望领导见谅。', '13991945457', '2016-01-11 15:47:04', '1', null, null, '0', '0', null, '0', null, '1', '2016-01-18 15:55:59', '0', null, '已通过电子邮件答复', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('53', '1', '2', '20161112', '丹凤县永顺汽贸修理厂', null, '', null, '电子邮件', '1686666088@qq.com', '陕西省丹凤县环城西路', '--', '我厂为机动车二类维修企业，在交通厅运输管理局网上查不到', '希望能予以公示', '13992419899', '2016-01-11 20:14:13', '1', null, null, '0', '0', null, '0', null, '1', '2016-01-18 08:37:21', '0', null, '已通过电话回复', null, null, '0', null, 'L-5940632-3', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('54', '1', '1', '2016115001', '个体', null, '622723196706302017', '于成林', '电话告知', '', '', '--', '驾照科目二考试预约', '驾照科目二考试预约', '13519106872', '2016-01-15 09:15:09', '1', null, null, '0', '0', null, '0', null, '1', '2016-01-18 15:55:38', '0', null, '已通过电话告知', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('55', '1', '1', '2016121001', '长安大学', null, '51102519900827011X', '杨郑', '电子邮件', '2015122080@chd.edu.cn', '陕西省西安市雁塔区长安中路161号长安大学小寨校区', '--', '近四年陕西省农村客运相关情况', '科研', '', '2016-01-21 16:29:04', '1', null, null, '0', '0', null, '0', null, '1', '2016-01-27 14:52:10', '0', null, '已通过电话回复', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('56', '1', '1', '2016125001', '西安市未央区', null, '610424199009105835', '赵景龙', '电话告知', '125941152@qq.com', '陕西省咸阳市乾县', '--', '宝鸡汽车东站，买不到去凤翔县的车票，作为始发站，给予乘客买票的时间只有四、五分钟甚至更短时间，就这四、五分钟还要自己去关注，售票员不会告诉你，并且态度不好，对于买不到票，值班站长给出的解释是车站为了统一管理。呵呵，要车站有什么用，自己在外面乘车，车来了，我就能上去，能买票；在车站里，车来了，我不知道，我还在等，车走了，我还在等，等着买票', '好好查查宝鸡汽车东站，本来与人方便的事，怎么就成这样了', '18109202728', '2016-01-25 13:23:36', '1', null, null, '0', '0', null, '0', null, '1', '2016-01-29 09:33:34', '0', null, '已通过电话答复', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('57', '1', '1', '2016315001', '无业', null, '610323197502064212', '苏军英', '电话告知', '', '', '--', '我自己有一两营运客车.请问客车的营运年限和怎么划分；高速和低速分别的年限，这个文件在那里找，需要祥细的划分', '学习', '13991725806', '2016-03-15 23:02:37', '1', null, null, '0', '0', null, '0', null, '1', '2016-04-05 09:10:26', '0', null, '已于3月25日电话联系，本人电话未接通，随后4月5日拨通电话后告知', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('58', '1', '1', '2016328001', '靖边县道路运输管理所', null, '612725196912010016', '张宏选', '电话告知', '1053990701@qq.com', '', '--', '运管工作中遇到的困难', '方便开展工作', '', '2016-03-28 20:42:26', '1', null, null, '0', '0', null, '0', null, '1', '2016-04-05 09:13:04', '0', null, '所提问题不明确，4月5日电话联系无人接听', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('59', '1', '1', '2016411001', '无', null, '230502198605140719', '王雷', '电话告知', 'luolunmail@163.com', '', '--', '监管驾培科电话', '我拨打96716对驾校进行投诉，但是现在已经15个工作日了，驾培科仍然没有给我答复，与说的7个工作日有消息，根本就是欺骗，而且驾培科留给96716的三个电话一个没人接，两空号，这个是欺骗百姓么？', '1535721176', '2016-04-11 14:40:55', '1', null, null, '0', '0', null, '0', null, '1', '2016-04-12 16:23:57', '0', null, '所提问题不明确，已于4月12日联系投诉人，投诉人申请重新投诉。', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('60', '1', '1', '2016412001', '无', null, '230502198605140719', '王雷', '电话告知', 'luolunmail@163.com', '', '--', '2013年我报名华津驾校长安区文苑北路分校，学费4000,2015年底第一次考科二，期间在马路旁练车几次，他们让交驾校练圈钱，每两圈120，没过，之后2016年3月份打电话说要改革让考试，这次收费改为前两圈200，之后每两圈240，他们建议我交1200，说是给车管所的包过费，我不同意，不想去练车，驾校不让考，姓贺的教练说不练不让过，协商未果要求退费，他们说给车管所交了2700多，我咨询车管所他们说他们只收费530，我只要求他们提供营业证明、贺教练的教练证和收费专用收据，他们拒不提供，再次协商未果，我拨打96716进行投诉，已经快十五个工作日了，仍然没人处理，希望交通厅能给我一个满意的答复，为百姓做主', '驾校不正规，投诉无门', '15353721176', '2016-04-12 14:40:37', '1', null, null, '0', '0', null, '0', null, '1', '2016-04-15 16:01:55', '0', null, '关于王雷投诉西安华津驾校“驾校不正规，投诉无门”的 回复\r\n王雷：\r\n你好，接到您的投诉后，我们立即进行了受理，并按照属地管理的原则将您投诉转给西安市维管处，该处领导高度重视，立即安排相关科室进行调查处理,现将西安市维管处调查处理结果告知如下：\r\n学员王雷2014年在西安华津驾校缴纳4000元培训费，学习C1机动车驾驶证培训。经调查，学员已经参加了科目二考试，但未通过考试，学员向驾校提出退费要求后，驾校予以推诿，不积极处理，经行业管理部门协调处理，华津驾校与学员就退费问题达成一致意见，退还学员2000元，学员表示满意。因教练存在未严格执行“一次性收费”政策，驾校对涉事教练已经做开除处理。\r\n    西安市维管处要求华津驾校严格遵守相关行业法律法规，进一步加强各报名联络点的管理，加强教练员的管理，合理安排培训考试工作，安排专人合理公平公正的处理学员投诉问题。\r\n   我局将进一步对相关问题进行深度关注，严格履行行业管理职责，切实维护和保障群众合法权益。\r\n', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('61', '1', '1', '2016415001', '无', null, '230502198605140719', '王雷', '电话告知', 'luolunmail@163.com', '', '--', '2016年4月14日，我通过贵网站对华津驾校文苑北路分校网点进行投诉退费，省厅回复很及时，总校态度很好，他们并不怎么配合，处理过程中因为无人说明和监督他们导致一些问题被驾校欺骗，根据后续省厅同志说明才只有有一些地方被骗，首先每次练车完成后并没有让我签字，退费过程中说我练车28次，无法证实，其次我科目一已经考完本可以通过更改驾校的方式无需再次考科目一，他们却在我不了解的情况下让我签了退办合同，对我产生了损失，最后反馈结果说涉事教练已经开除，但是我去沟通的时候仍然看到其在继续带学员在马路边上练车，我觉得他们不仅欺骗了学员，也欺骗了省厅，而且我这次去看到他们挂墙上的运输管理证件的到期日期为2011年，视国家法律于不顾，希望省厅能为民除去这个毒瘤', '直接审核该网点是否属于合法运营，并严格执行处理方案', '15353721176', '2016-04-15 20:37:44', '1', null, null, '0', '0', null, '0', null, '1', '2016-04-21 16:46:08', '0', null, '您好，您第二次反映的问题我局已收悉，经过我们了解，现回复如下：一、我们责成西安市华津驾校就您反映的问题进行严肃查处，该驾校于2016年4月19日拿出处理意见：对教练员贺俊良给予严重批评教育停职三个月；二、要求西安华津驾校以此事为戒，加强教练员管理和内部管理工作；三、感谢您对我们驾培工作的监督，希望您继续监督和支持我们的驾培工作。', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('62', '1', '1', '201652001', '西安美仕达汽车服务有限公司', null, '61032219820523114X', '刘海妮', '电话告知', '853567166@qq.com', '西安市雁塔区高新二路光德路5号', '--', '我单位属于二类维修厂，单位的道路运输经营许可证到2016年9月2日到期，现申请办理更换业务，请接洽！', '维修资质年检和换本', '17792262898', '2016-05-02 16:41:05', '1', null, null, '0', '0', null, '0', null, '1', '2016-05-04 08:22:18', '0', null, '依据《陕西省机动车维修行政许可工作规范》第四章第十五条（二）机动车维修企业在行政许可有效期届满前30日内向原许可的道路运输管理机构提出延续许可书面申请，道路运输管理机构逾期未做出决定的，视为准予原行政许可决定延续。\r\n西安美仕达汽车服务有限公司的道路运输经营许可证2016年9月2日到期，到期前30日向原许可机构提出书面申请即可。以上内容已电话答复刘海妮\r\n', null, null, '0', null, '', '0');
INSERT INTO `sxtm_ysqgk` VALUES ('63', '1', '1', '201653001', '北京微码邓白氏营销咨询有限公司', null, '652201198701071220', '陆雪娇', '电子邮件', '443564416@qq.com', '广州市天河区华夏路30号富力盈通大厦41楼', '--', '一，《交通运输综合统计报表制度》报表\r\n1.交行统7-1表   公路旅客营运车辆拥有量 \r\n二，《道路运输统计报表制度》报表\r\n道路客运班线\r\n三，《陕西省道路运输企业统计报表制度》\r\n1.陕交运企1表  客运汽车站旅客发送情况\r\n2.陕交运企2表  道路班线客运企业运输情况\r\n3.陕交运企3表 道路旅游（包车）客运企业运输情况\r\n四，《运输邮电业统计报表制度》\r\n1.统计局D348  《全市（区，县）营业性运输车辆按车型分类数量》', '用于陕西客运市场调研与分析', '13825166356', '2016-05-03 15:19:24', '1', null, null, '0', '0', null, '0', null, '1', '2016-05-12 13:32:01', '0', null, '您好，您需要提供本单位介绍信，我局才能提供相关数据信息。（我单位通信地址：陕西省西安市莲湖区药王洞18号 陕西省交通厅运输管理局 邮编710003） 5月12日该单位将介绍信发送至我局后，局规划处已将数据发送至443564416邮箱。', null, null, '0', null, '', '0');
