DROP TABLE IF EXISTS `aos_comment`;
CREATE TABLE `aos_comment` (
  `comment_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户评论的自增id',
  `id_value` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '商品的id',
  `content` text NOT NULL COMMENT '评论的内容',
  `comment_rank` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '该文章或者商品的重星级;只有1到5星;由数字代替;其中5代表5星',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '评论的时间',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否被管理员批准显示;1是;0未批准显示',
  `parent_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '评论的父节点,取值该表的comment_id字段,如果该字段为0,则是一个普通评论,否则该条评论就是该字段的值所对应的评论的回复',
  `user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '发表该评论的用户的用户id,取值user的user_id',
  `order_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '订单id',
  `is_top` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '推荐',
  PRIMARY KEY (`comment_id`),
  KEY `parent_id` (`parent_id`),
  KEY `id_value` (`id_value`)
