DROP TABLE IF EXISTS `aos_goods_album`;
CREATE TABLE `aos_goods_album` (
  `album_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '商品相册ID',
  `goods_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '图片属性商品的id',
  `album_img` varchar(255) NOT NULL DEFAULT '' COMMENT '实际图片url',
  `album_sort` smallint(4) unsigned NOT NULL DEFAULT '0' COMMENT '图片排序',
  PRIMARY KEY (`album_id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=68 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of aos_goods_album
-- ----------------------------

-- ----------------------------
-- Table structure for `aos_goods_attr`
-- ----------------------------
DROP TABLE IF EXISTS `aos_goods_attr`;
CREATE TABLE `aos_goods_attr` (
  `attr_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增ID号',
  `goods_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '该具体属性属于的商品，取值于goods的goods_id',
  `attr_value` text NOT NULL COMMENT '该具体属性的值',
  `attr_price` varchar(255) NOT NULL DEFAULT '' COMMENT '该属性对应在商品原价格上要加的价格',
  `attr_img` varchar(255) NOT NULL DEFAULT '',
  `sort_order` smallint(4) unsigned NOT NULL DEFAULT '10',
  `product_sn` varchar(20) NOT NULL,
  `product_number` int(4) NOT NULL,
  PRIMARY KEY (`attr_id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of aos_goods_attr
