-- Table structure for `aos_goods_label`
-- ----------------------------
DROP TABLE IF EXISTS `aos_goods_label`;
CREATE TABLE `aos_goods_label` (
  `label_id` tinyint(3) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id号',
  `label_name` varchar(50) NOT NULL DEFAULT '' COMMENT '标签名称',
  `label_desc` varchar(100) DEFAULT '' COMMENT '标签介绍',
  `enabled` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否被禁用，1，可用；0，禁用',
  `sort_order` tinyint(3) unsigned NOT NULL DEFAULT '10' COMMENT '排序',
  PRIMARY KEY (`label_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

