-- ----------------------------
DROP TABLE IF EXISTS `aos_lottery`;
CREATE TABLE `aos_lottery` (
  `lottery_id` mediumint(8) NOT NULL AUTO_INCREMENT,
  `goods_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `lottery_start_time` int(11) NOT NULL DEFAULT '0',
  `lottery_end_time` int(11) NOT NULL DEFAULT '0',
  `lottery_tuan_num` smallint(5) unsigned NOT NULL DEFAULT '0',
  `lottery_price` decimal(10,2) NOT NULL DEFAULT '0.00',
  `lottery_desc` text,
  `lottery_number` smallint(5) unsigned DEFAULT '0',
  `lottery_sales` int(10) unsigned DEFAULT '0' COMMENT '已购买',
  `lottery_won` varchar(50) DEFAULT NULL COMMENT '中奖用户',
  `lottery_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '抽奖状态',
  `enabled` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '首页推荐',
  `goods_attr` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`lottery_id`)
