CREATE TABLE `aos_menu` (
  `menu_id` tinyint(3) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id号',
  `menu_name` varchar(50) NOT NULL DEFAULT '' COMMENT '菜单名称',
  `menu_url` varchar(100) DEFAULT '' COMMENT '菜单链接',
  `enabled` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否被禁用，1，可用；0，禁用',
  `sort_order` tinyint(3) unsigned NOT NULL DEFAULT '10' COMMENT '排序',
  `menu_img` varchar(100) DEFAULT NULL COMMENT '菜单图标',
  `type` tinyint(1) DEFAULT '0' COMMENT '0：商城  1：小程序',
