-- ----------------------------
-- Table structure for `aos_order_goods`
-- ----------------------------
DROP TABLE IF EXISTS `aos_order_goods`;
CREATE TABLE `aos_order_goods` (
  `rec_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '订单商品信息自增id',
  `order_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '订单商品信息对应的详细信息id，取值order_info的order_id',
  `goods_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '商品的的id，取值表goods 的goods_id',
  `goods_name` varchar(120) NOT NULL DEFAULT '' COMMENT '商品的名称，取值表goods',
  `goods_sn` varchar(60) NOT NULL DEFAULT '' COMMENT '商品的唯一货号，取值goods',
  `goods_number` smallint(5) unsigned NOT NULL DEFAULT '1' COMMENT '商品的购买数量',
  `market_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品的市场售价',
  `goods_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品的本店售价',
  `goods_attr` text NOT NULL COMMENT '购买该商品时所选择的属性',
  `attr_id` varchar(255) NOT NULL DEFAULT '',
  PRIMARY KEY (`rec_id`),
  KEY `order_id` (`order_id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1404 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of aos_order_goods
-- ----------------------------

-- ----------------------------
-- Table structure for `aos_order_info`
-- ----------------------------
DROP TABLE IF EXISTS `aos_order_info`;
CREATE TABLE `aos_order_info` (
  `order_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `order_sn` varchar(20) NOT NULL DEFAULT '' COMMENT '订单号,唯一',
  `user_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '用户id,同users的user_id',
  `order_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '订单的状态;0未确认,1确认,2已取消,3无效,4退货,5完成',
  `shipping_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '商品配送情况;0未发货,1已发货,2已收货,4退货',
  `pay_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '支付状态;0未付款;1付款中;2已付款',
  `consignee` varchar(60) NOT NULL DEFAULT '' COMMENT '收货人的姓名',
  `area` varchar(20) NOT NULL DEFAULT '' COMMENT '收货人的地区',
  `address` varchar(255) NOT NULL DEFAULT '' COMMENT '收货人的详细地址',
  `mobile` varchar(60) NOT NULL DEFAULT '' COMMENT '收货人的手机',
  `postscript` varchar(255) NOT NULL DEFAULT '' COMMENT '订单附言',
  `shipping_id` tinyint(3) NOT NULL DEFAULT '0' COMMENT '配送方式id',
  `shipping_name` varchar(120) NOT NULL DEFAULT '' COMMENT '配送方式的名称',
  `pay_id` tinyint(3) NOT NULL DEFAULT '0' COMMENT '支付方式的id',
  `pay_name` varchar(120) NOT NULL DEFAULT '' COMMENT '支付方式名称',
  `goods_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品的总金额',
  `shipping_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '配送费用',
  `money_paid` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '已付款金额',
  `surplus` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '该订单使用金额的数量,取用户设定余额,用户可用余额,订单金额中最小者',
  `integral` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '使用的积分的数量,取用户使用积分,商品可用积分,用户拥有积分中最小者',
  `integral_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '使用积分金额',
  `bonus` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '使用红包金额',
  `order_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '应付款金额',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '订单生成时间',
  `confirm_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '订单确认时间',
  `pay_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '订单支付时间',
  `shipping_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '订单配送时间',
  `suc_tuan_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '成团时间',
  `bonus_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '红包id, user_bonus的bonus_id',
  `invoice_no` varchar(255) NOT NULL DEFAULT '' COMMENT '发货时填写, 可在订单查询查看',
  `extension_code` varchar(30) NOT NULL DEFAULT '' COMMENT '活动类型 tuan 拼团 miao 秒杀 lottery 抽奖 assist 助力',
  `extension_id` varchar(20) NOT NULL DEFAULT '' COMMENT '活动id',
  `to_buyer` varchar(255) NOT NULL DEFAULT '' COMMENT '商家给客户的留言,当该字段值时可以在订单查询看到',
  `pay_note` varchar(255) NOT NULL DEFAULT '' COMMENT '付款备注, 在订单管理编辑修改',
  `store_id` int(3) unsigned NOT NULL DEFAULT '0' COMMENT '门店id',
  `discount` decimal(10,2) NOT NULL COMMENT '折扣',
  `lastmodify` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '修改时间',
  `tuan_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '团购状态 0初始状态 1正在进行 2成功 3失败退款 4已退款',
  `tuan_num` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '团购人数',
  `tuan_first` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '团长',
  `comment` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否评论',
  `veri_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '核销时间',
  `veri_uname` varchar(50) NOT NULL COMMENT '核销员',
  `veri_uid` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '核销员id',
  `act_id` mediumint(8) unsigned DEFAULT '0' COMMENT '秒杀或抽奖id',
  `is_luck` tinyint(1) unsigned DEFAULT '0' COMMENT '是否中奖',
  `assist_num` mediumint(8) unsigned DEFAULT '0' COMMENT '助力人数',
  `parent_id` mediumint(8) unsigned DEFAULT '0' COMMENT '推广用户id',
  `is_dist` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否分销',
  `less_alert` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '人数不足提醒',
  PRIMARY KEY (`order_id`),
  UNIQUE KEY `order_sn` (`order_sn`),
  KEY `user_id` (`user_id`),
  KEY `order_status` (`order_status`),
  KEY `shipping_status` (`shipping_status`),
  KEY `pay_status` (`pay_status`),
  KEY `shipping_id` (`shipping_id`),
  KEY `pay_id` (`pay_id`),
  KEY `extension_code` (`extension_code`,`extension_id`),
  KEY `agency_id` (`store_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1406 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of aos_order_info
-- ----------------------------

-- ----------------------------
-- Table structure for `aos_pay_log`
-- ----------------------------
DROP TABLE IF EXISTS `aos_pay_log`;
CREATE TABLE `aos_pay_log` (
  `log_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '支付记录自增id',
  `order_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '对应的交交易记录的id,取值表order_info',
  `order_amount` decimal(10,2) unsigned NOT NULL COMMENT '支付金额',
  `order_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '支付类型,0订单支付,1会员预付款支付',
  `is_paid` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否已支付,0否;1是',
  PRIMARY KEY (`log_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1196 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of aos_pay_log
-- ----------------------------

-- ----------------------------
-- Table structure for `aos_payment`
-- ----------------------------
DROP TABLE IF EXISTS `aos_payment`;
CREATE TABLE `aos_payment` (
  `pay_id` tinyint(3) unsigned NOT NULL AUTO_INCREMENT COMMENT '已安装的支付方式自增id',
  `pay_code` varchar(20) NOT NULL DEFAULT '' COMMENT '支付方式 的英文缩写,其实是该支付方式处理插件的不带后缀的文件名部分',
  `pay_name` varchar(120) NOT NULL DEFAULT '' COMMENT '支付方式名称',
  `pay_order` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '支付方式在页面的显示顺序',
  `pay_config` text NOT NULL COMMENT '支付方式的配置信息,包括商户号和密钥什么的',
  `enabled` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否可用;0否;1是',
  PRIMARY KEY (`pay_id`),
  UNIQUE KEY `pay_code` (`pay_code`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of aos_payment
-- ----------------------------

