-- ----------------------------
-- Table structure for `aos_seckill`
-- ----------------------------
DROP TABLE IF EXISTS `aos_seckill`;
CREATE TABLE `aos_seckill` (
  `seckill_id` mediumint(8) NOT NULL AUTO_INCREMENT,
  `goods_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `seck_start_time` int(11) NOT NULL DEFAULT '0',
  `seck_end_time` int(11) NOT NULL DEFAULT '0',
