  `seck_price` decimal(10,2) NOT NULL DEFAULT '0.00',
  `seck_desc` text,
  `seckill_number` smallint(5) unsigned DEFAULT '0',
  `seckill_sales` int(10) unsigned DEFAULT '0' COMMENT '已购买',
  `goods_attr` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`seckill_id`)
