  `shipping_name` varchar(120) NOT NULL DEFAULT '' COMMENT '配送方式名称',
  `enabled` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '该配送方式是否被禁用，1，可用；0，禁用',
