-- ----------------------------
-- Table structure for `aos_shop_config`
-- ----------------------------
DROP TABLE IF EXISTS `aos_shop_config`;
CREATE TABLE `aos_shop_config` (
  `id` smallint(5) unsigned NOT NULL AUTO_INCREMENT COMMENT '全站配置信息自增id',
  `parent_id` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '父节点id，取值于该表id字段的值',
  `code` varchar(30) NOT NULL DEFAULT '' COMMENT '跟变量名的作用差不多，其实就是语言包中的字符串索引',
  `type` varchar(10) NOT NULL DEFAULT '' COMMENT '该配置的类型，text，文本输入框',
  `store_range` varchar(255) NOT NULL DEFAULT '' COMMENT '当语言包中的code字段对应的是一个数组时，那该处就是该数组的索引',
  `store_dir` varchar(255) NOT NULL DEFAULT '' COMMENT '当type为file时才有值，文件上传后的保存目录',
  `value` text NOT NULL COMMENT '该项配置的值',
  `sort_order` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '显示顺序，数字越大越靠后',
  PRIMARY KEY (`id`),
  UNIQUE KEY `code` (`code`),
  KEY `parent_id` (`parent_id`)
) ENGINE=InnoDB AUTO_INCREMENT=919 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

