-- ----------------------------
-- Table structure for `aos_user_account`
-- ----------------------------
DROP TABLE IF EXISTS `aos_user_account`;
CREATE TABLE `aos_user_account` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id号',
  `user_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '用户登录后保存在session中的id号，跟users表中的user_id对应',
  `admin_user` varchar(255) NOT NULL COMMENT '操作该笔交易的管理员的用户名',
  `amount` decimal(10,2) NOT NULL COMMENT '资金的数目，正数为增加，负数为减少',
  `add_time` int(10) NOT NULL DEFAULT '0' COMMENT '记录插入时间',
  `paid_time` int(10) NOT NULL DEFAULT '0' COMMENT '记录更新时间',
  `admin_note` varchar(255) NOT NULL COMMENT '管理员的被准',
  `user_note` varchar(255) NOT NULL COMMENT '用户备注',
  `process_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '操作类型，1，退款；0，预付费，其实就是充值；2 ,佣金体现',
  `payment_name` varchar(90) NOT NULL COMMENT '支付渠道的名称，取自payment的pay_name字段',
  `is_paid` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已经付款，０，未付；１，已付',
  `payment_id` tinyint(3) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `is_paid` (`is_paid`)
) ENGINE=InnoDB AUTO_INCREMENT=113 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of aos_user_account
-- ----------------------------

