  `consignee` varchar(60) NOT NULL DEFAULT '' COMMENT '收货人的名字',
  `area` varchar(20) NOT NULL DEFAULT '' COMMENT '收货人的地区',
  `address` varchar(120) NOT NULL DEFAULT '' COMMENT '收货人的地址',
  `mobile` varchar(11) NOT NULL DEFAULT '' COMMENT '收货人的手机',
  PRIMARY KEY (`address_id`),
  KEY `user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=410 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of aos_user_address
