-- ----------------------------
-- Table structure for `aos_users`
-- ----------------------------
DROP TABLE IF EXISTS `aos_users`;
CREATE TABLE `aos_users` (
  `user_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '会员自增id',
  `openid` varchar(32) DEFAULT NULL COMMENT '当前公众号唯一open_id',
  `x_openid` varchar(32) NOT NULL COMMENT '小程序openid',
  `mobile` varchar(11) NOT NULL COMMENT '移动电话',
  `realname` varchar(30) NOT NULL DEFAULT '' COMMENT '真实姓名',
  `nickname` varchar(32) NOT NULL COMMENT '昵称',
  `sex` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '性别',
  `headimgurl` varchar(200) NOT NULL COMMENT '图像',
  `country` varchar(20) NOT NULL COMMENT '国家',
  `province` varchar(20) NOT NULL COMMENT '省份',
  `city` varchar(20) NOT NULL COMMENT '城市',
  `user_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '现有资金',
  `frozen_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '冻结资金',
  `pay_points` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '消费积分',
  `address_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '收货信息id',
  `last_login` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '最后一次登录时间',
  `visit_count` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '访问次数',
  `parent_id` mediumint(9) NOT NULL DEFAULT '0' COMMENT '推荐人会员id',
  `froms` char(10) NOT NULL DEFAULT 'pc' COMMENT 'pc:电脑,mobile:手机,wechat:微信,app:应用',
  `unionid` varchar(32) NOT NULL COMMENT '众号绑定到微信开放平台帐号后，才会出现该字段',
  `subscribe` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '用户是否订阅该公众号标识，值为0时，代表此用户没有关注该公众号',
  `subscribe_time` int(11) NOT NULL COMMENT '用户关注时间，为时间戳。如果用户曾多次关注，则取最后关注时间',
  `remark` varchar(200) NOT NULL COMMENT '公众号运营者对粉丝的备注，公众号运营者可在微信公众平台用户管理界面对粉丝添加备注',
  `groupid` varchar(30) NOT NULL COMMENT '用户所在的分组ID',
  `tagid_list` varchar(100) NOT NULL COMMENT '用户被打上的标签ID列表',
  `reg_time` int(10) unsigned NOT NULL DEFAULT '0',
  `sign_days` int(5) DEFAULT NULL COMMENT '连续签到天数',
  `sign_last_time` bigint(11) DEFAULT NULL COMMENT '最后签到时间',
  `rank_points` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '等级积分',
  `virtual` tinyint(1) unsigned DEFAULT '0' COMMENT '虚拟会员',
  `dist_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '佣金',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `openid` (`openid`),
  KEY `parent_id` (`parent_id`),
  KEY `nickname` (`nickname`),
  KEY `mobile` (`mobile`),
  KEY `nickname_2` (`nickname`)
) ENGINE=InnoDB AUTO_INCREMENT=1085 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of aos_users
-- ----------------------------

