-- ----------------------------
DROP TABLE IF EXISTS `sxtm_ysqgk`;
CREATE TABLE `sxtm_ysqgk` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `siteid` int(11) DEFAULT '1' COMMENT '属于哪个站点',
  `lx` varchar(10) DEFAULT '法人' COMMENT '法人 或者 公民',
  `number_id` varchar(50) DEFAULT '' COMMENT '随机编号',
  `user_dw` varchar(50) DEFAULT NULL COMMENT '单位名称',
  `faren_name` varchar(50) DEFAULT NULL COMMENT '法人姓名',
  `zuzhidama` varchar(255) DEFAULT NULL COMMENT '组织机构代码或身份证号码',
  `username` varchar(50) DEFAULT NULL COMMENT '联系人',
  `huikui` varchar(10) DEFAULT NULL COMMENT '回馈方式',
  `email` varchar(50) DEFAULT NULL COMMENT '电子邮箱',
  `address` varchar(50) DEFAULT NULL COMMENT '联系电址',
  `fax` varchar(20) DEFAULT NULL COMMENT '传真',
  `content` text COMMENT '内容描述',
  `content_yt` text COMMENT '信息用途',
  `tel` varchar(50) DEFAULT NULL COMMENT '联系电话',
  `updatetime` datetime DEFAULT NULL COMMENT '用户申请时间',
  `shouli` int(11) DEFAULT '0' COMMENT '受理，0为未受理，1已受理',
  `shoulitime` datetime DEFAULT NULL COMMENT '受理时间',
  `gaozhitime` datetime DEFAULT NULL,
  `gaozhi` int(11) DEFAULT '0' COMMENT '告知，0未告知，1已告知',
  `buzheng` int(11) DEFAULT '0' COMMENT '0未补正，1已补正',
  `buzhengtime` datetime DEFAULT NULL,
  `zhuanban` int(11) DEFAULT '0' COMMENT '转办，0未转办，1已转办',
  `zhuanbantime` datetime DEFAULT NULL,
  `dafu` int(11) DEFAULT '0' COMMENT '答复，0未答复，1已答复',
  `dafutime` datetime DEFAULT NULL,
